import React from 'react'
import {BrowserRouter,Route, Routes,Link} from 'react-router-dom';
import Login from './Login';
import SignUp from './SignUp';
const App = () => {
  return (
    <div>
        <BrowserRouter>
        <Link to="/login"><Login></Login></Link>
        <Link to="/signup"><SignUp></SignUp></Link>
        </BrowserRouter>
    </div>
  )
}

export default App
